import {StyleSheet} from "react-native";

export const styles = StyleSheet.create({
  container: {
    backgroundColor: "#122f5b",
    flex: 1,
    flexDirection: "column",
    alignItems: "center"
  }
});

export const modalStyles = StyleSheet.create({
  cameraContainer: {
    flex: 1,
    margin: 0
  },
})

export default styles;
